    vector_addwave = np.zeros(10)
    wl_sl_temp = wl_sl
    if wl_sl > 4.0:
        wl_sl_temp = 4.0
    if wl_sl < 0.5:
        wl_sl_temp = 0.5

    for k in range(1, 30, 1):
        k = np.int(np.round((wl_sl_temp - 0.4) * 10))
        GG = [math.ceil(wl_sl_temp * 10) / 10 - 0.1, math.ceil(wl_sl_temp * 10) / 10]
        for j in range(0, 10, 1):
            HH = [float(coefficient_addwave[k][j]), float(coefficient_addwave[k + 1][j])]
            vector_addwave[j - 1] = interpolate.interp1d(GG, HH)(wl_sl_temp)

    # calculate resistance
    R_addwaves = vector_addwave[0]+vector_addwave[1]*(lwl/disp**(1/3)) + vector_addwave[2]*(lwl/disp**(1/3))**2 + \
            vector_addwave[3]*(lwl/disp**(1/3))**3 + vector_addwave[4]*(lwl/bwl) + vector_addwave[5]*(lwl/bwl)**2 + \
            vector_addwave[6]*(bwl/tc) + vector_addwave[7]*cp + vector_addwave[8]*cp**2 + vector_addwave[9]*cp**3 
    R_addwaves = R_addwaves * 1025 * 9.8 * wave_height


    # 2 IMS FORMULATION 
    # Claughton 1999 - Developments in the IMS VPP Formulations
    fn = froude_number
    vel_true_wind = 8 # knots
    angle_true_wind = wave_angle
    gyr = kyy * lwl
    lcb = 0.53
    lcf = 0.57
    fs = 0.8 # ajuste de forca

    f0 = vel_true_wind * (1 - 0.8375 * (1.175 ** (-0.00284 * vel_true_wind ** 3.5)))
    f1 = np.cos(np.radians(angle_true_wind)) 
    f2 = 0.5059 * np.log(lwl/40) + 1
    f3 = 0.00191 * (fn - 0.325)
    f4 = 0.01575 * (gyr - 0.25)
    f5 = (5.23 ** (-lwl/bwl) - 5.23 ** (-3.327)) / 8.494 
    f6 = 0.000166 * (bwl/tc - 4.443)
    f7 = 0.01150 * (lcb - lcf + 0.03) + 0.05780 * ((lcb -lcf) ** 2 - 0.03 ** 2)

    R_addwaves_IMS = 2 * 1025 * 9.81 * lwl * fs * f0 * 0.55 * f1 * f2 * (0.00146 + f3 + f4 + f5 + f6 +f7)

    # 3 DYNAMIC RIGHTING MOMENT
    lsm = 0 # ? 
    slr = 0 # speed lenght ratio
    scb = 1 # maximum section area of cone body
    phi = 0 # speed lenght ratio
    
    RMV = 5.955e-5 / 3 * disp * lsm * (1 - 6.25 * bwl / scb ** 0.5 - 2.1) * slr * phi
    

    return R_addwaves

